import headerLeft from "./headerLeft";
export default function header() {
  return (
    <div className="header">
      <div className="full-header"></div>
      {/* <headerLeft /> */}hola
      <style jsx>{`
        header {
          float: left;
          width: 100%;
          position: relative;
        }
        .full-header {
          float: left;
          width: 100%;
          padding: 0 6%;

          background: #ff5959;
          text-align: center;
        }
        .full-header:hover {
          background: #ff5959;
        }
      `}</style>
    </div>
  );
}
